import React from 'react'
import styled from "styled-components"
import spotifyLogo from './spotifyIcon.png';
import appleIcon from "./appleIconWhite.svg";

const Card = styled.div`
    position:relative;
    height:100px;
    width:95%;
    background-color: #009688;  
    margin: 20px auto;
    padding:auto;
    border-radius:6px;
    filter:drop-shadow(5px 5px 5px black);
`
const Chapter = styled.span`
    color: white;
    position:absolute;
    left:2%;
    top:30%;

    padding:10px;
    border-radius:6px;
    background-color:black
`
export default function OldPlaylistCard(props) {
    return (
        <Card>
            <Chapter>{props.Chapter}: {props.Name}</Chapter>
            <img src={appleIcon} alt="apple-logo"/>
            <img src={spotifyLogo} alt="spotify-logo"/>
        </Card>
    )
}
